def maximumuniquesubarray(nums):
    n = len(nums)
    left = right = score = 0
    store = {}
    
    while right < n:
        num = nums[right]

        if num not in store:
            store[num] = right
            s = sum(store.keys())
            
            if s > score:
                score = s
            
            right += 1
        else:
            index = store[num]
            store = dict(list(store.items())[index + 1:])
            left = index
    return score

